export function PositionsList({ chord }) {
  // console.log(chord);
  let id = 0;
  return (
    <ul>
      {chord.map((pos) => (
        <>
          <li key={id}>{pos.midi[0]}</li>
          <li key={id}>{pos.midi[1]}</li>
        </>
      ))}
    </ul>
  );
}
